import React from 'react';
import { Route, Switch } from 'react-router-dom';
import Greeting from './Greeting';

function App() {
  return (
    <div className="App">
      <Switch>
        <Route path="/" component={Greeting} />
      </Switch>
    </div>
  );
}

export default App;
